import React from 'react';
import '../styles/mlbPage.css';

const MlbPage = () => {
  return (
    <div className="about-container">
      <h1>MLB 페이지</h1>
      <div>선수기록
      <div>타자기록</div>
      <div>투수기록</div>
      <div>수비기록</div>
      </div>
      <div>팀기록
      <div>타자기록</div>
      <div>투수기록</div>
      <div>수비기록</div>
      </div>
   </div>
  );
};

export default MlbPage;
